import {useSelector, useDispatch} from "react-redux";
import { logout,setPreference } from "../redux/actions";
import OnboardingSlides from "../components/OnboardingSlides";
import Search from "../components/Search"
import Saved from "../components/Saved"

const Home = () => {
    const onboardingComplete = useSelector(state => state.user.onboardingComplete);
    const preferences = useSelector(state => state.user.search);
    const dispatch = useDispatch();

    const handleLogout = () => {
        dispatch(logout());
    }

    const updatePreference = (language) => {
        if (language.target.checked) {
            dispatch(addPreference(language.target.value.toUppercase()));
        }
        else {
            dispatch(removePreference(language.target.value.toUppercase()));
        }
    }

    if (onboardingComplete) {
        return (
            <>
                <nav className="navbar navbar-dark">
                    <div className="container-fluid">
                        <a className="navbar-brand mx-auto font title" href="#home" onClick={()=>{}}>
                            Jobs
                        </a>
                        <form class="d-flex">
                            <button class="btn btn-outline-light" onClick={handleLogout}>Logout</button>
                        </form>
                    </div>
                </nav>
                <ul class="nav justify-content-center">
                    <li class="nav-item">
                        <a class="nav-link active option" aria-current="page" href="#">Search</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link option" href="#">Saved</a>
                    </li>
                </ul>
                <div className="container-fluid">
                    <div className="row">
                        <h5 className="col text-center">
                            Select language(s)
                        </h5>
                    </div>
                    <div className="justify-content-center text-center">

                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox1" value="Python" onChange={(e) => updatePreference(e)}/>
                        <label class="form-check-label" for="inlineCheckbox1">Python</label>
                    </div>
                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox2" value="option2" onChange={(e) => updatePreference(e)}/>
                        <label class="form-check-label" for="inlineCheckbox2">Java</label>
                    </div>
                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox1" value="option1" onChange={updatePreference}/>
                        <label class="form-check-label" for="inlineCheckbox1">C</label>
                    </div>
                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox2" value="option2" onChange={updatePreference}/>
                        <label class="form-check-label" for="inlineCheckbox2">C#</label>
                    </div>
                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox1" value="option1" onChange={updatePreference}/>
                        <label class="form-check-label" for="inlineCheckbox1">Javascript</label>
                    </div>
                    <div class="form-check form-check-inline">
                        <input class="form-check-input" type="checkbox" id="inlineCheckbox2" value="option2" onChange={updatePreference}/>
                        <label class="form-check-label" for="inlineCheckbox2">MySQL</label>
                    </div>

                    </div>
                </div>
                <div id="listings">
                    <Search />
                </div>
            </>
        )
    } else {
        return (
            <OnboardingSlides/>
        )
    }
}

export default Home
